import React from "react";
import './Home.css';

const Home = () => {
  return (
    <>
      <div className="header">
        <div className="blogo">
        <img src="./assets/logo.png" alt="ss" />
         </div>
        <div className="search">
           <form>
           <select>
              <option>All</option>
              <option>Home and Garden</option>
              <option>Shoes</option>
              <option>Watches</option>
              <option>Electronics components</option>
            </select>
            <input type="text" placeholder="Search for products"></input>
            <button>Go</button>
          </form>
        </div> 
        
        <div className="icons">
         <img src="./assets/hart_ic@3x.png"></img>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
         <img src="./assets/cart_ic@3x.png"></img>
        </div>
        
      
      </div>
    </>
  );
};

export default Home;
